import React from 'react';

const Tags = () => {
    return (
        <div className="tags-container">
            <a href="#">Minimal Sunlight</a>
            <a href="#">Moderate Sunlight</a>
            <a href="#">Intense Sunlight</a>
            <a href="#">Less Water</a>
            <a href="#">More Water</a>
        </div>
    );
}

export default Tags;
